import React from "react";

const Table = ({orders}) => {
  return (
    <div className="card p-3">
     <table className="table table-striped">
        <thead>
            <tr>
                <th scope="col">Plato</th>
                <th scope="col">Cantidad</th>
                <th scope="col">Acciones</th>
            </tr>
        </thead>
     </table>
    </div>
  );
};

export default Table;
